import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Link to="context">
        <button>Go to context</button>
      </Link>
    </div>
  );
}

export default App;
